import React from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";
import HomeConts2 from "./HomeConts2";

const HomeConts1 = () => {
  return (
    <div>
      <Fullpage>
        <FullpageNavigation />
        <FullPageSections>
          <FullpageSection>
            <h1>Section1</h1>
          </FullpageSection>
          <HomeConts2 />
          <HomeConts3 />
          <HomeConts4 />
        </FullPageSections>
      </Fullpage>
    </div>
  );
};

export default HomeConts1;
